
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='1064' height='768'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #Layer_1
	
// #Layer_2
	
// #path5
	ctx.beginPath();
	ctx.fillStyle = 'rgb(2, 0, 0)';
	ctx.moveTo(196.000000, 275.000000);
	ctx.fill();
	
// #path7
	ctx.beginPath();
	ctx.fillStyle = 'rgb(2, 0, 0)';
	ctx.moveTo(598.000000, 341.000000);
	ctx.fill();
	
// #Layer_3
	
// #path10
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(193, 0, 0)';
	ctx.miterLimit = 10;
	ctx.moveTo(59.500000, 58.900000);
	ctx.lineTo(104.100000, 34.900000);
	ctx.lineTo(477.300000, 34.900000);
	ctx.lineTo(522.900000, 58.100000);
	ctx.lineTo(523.900000, 193.900000);
	ctx.lineTo(448.000000, 312.300000);
	ctx.bezierCurveTo(448.000000, 312.300000, 352.200000, 388.900000, 295.300000, 388.600000);
	ctx.bezierCurveTo(295.300000, 388.600000, 244.500000, 398.000000, 134.200000, 312.200000);
	ctx.lineTo(59.500000, 196.900000);
	ctx.lineTo(59.500000, 58.900000);
	ctx.closePath();
	ctx.stroke();

    </script>
</body>
</html>
